import React from 'react';
import ReactDOM from 'react-dom/client';

import PostForm from './components/PostApi';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <PostForm />
  </React.StrictMode>
);

